import { Component } from "react";

export default class PropsDemo extends Component {
    constructor(props) {
        super(props);
        this.state = { count: 0 }
    }

    handleChange = () => { this.setState({count:this.state.count+1}) }

    render() {
        return <>
            <h1>Count - {this.state.count}</h1>
            <button>Click me</button>
        </>
    }

}
